import React from 'react';
// import web from '../src/image/Team.svg';
// import web2 from '../src/image/Team2.jpg';
import Common from './Common'





const Team = () => {
    return (
        <>
            <div className='Team_section section_padding'>
                <div className='container'>
                    <h2 className='text-center text-primary mb-5'>Team Formation Details</h2>
                    <div className='row'>
                        <div className='col-md-6'>
                            <div className='py-2'>
                                <h6>Counceling Team</h6>
                                <p>
                                Providing counseling face to face,
                                 over the telephone, or online.
                                  Providing true Information about career
                                   options in civil Engineering & ways to achieve 
                                   them
                                </p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Team;
